// components/BuyFromFarmer.js
import React from 'react';
import './BuyFromFarmer.css';
import topRightImage from '../assets/topRightImage.png'; // Path to the top-right image

function BuyFromFarmer() {
  return (
    <div className="buyfromfarmer-section">
      <h2 className="section-heading">Buy from Farmers</h2>
      <div className="cards-container">
        {/* Horizontal scrolling cards */}
        <div className="card">
          <img src="path-to-crop-image.jpg" alt="Crop" className="card-image" />
          <h3>Wheat</h3>
          <p>Price: ₹1500</p>
          <p>City: Delhi</p>
        </div>
        <div className="card">
          <img src="path-to-crop-image.jpg" alt="Crop" className="card-image" />
          <h3>Rice</h3>
          <p>Price: ₹2000</p>
          <p>City: Bangalore</p>
        </div>
        {/* Add more cards as needed */}
      </div>
      <img src={topRightImage} alt="Decoration" className="top-right-image" />
    </div>
  );
}

export default BuyFromFarmer;
